  const mapStyles = {        
    height: "100vh",
    width: "100%"};

  const defaultCenter = {
    lat: 30.6123298, lng: -96.3412948
  }

  //30.6123298,-96.3412948,20.44z


  return (
     <LoadScript
       googleMapsApiKey='AIzaSyAOnc72pQ5JSAViN8Ec--HCDdehJDliCUw'>
        <GoogleMap
          mapContainerStyle={mapStyles}
          zoom={20.44}
          center={defaultCenter}
        />
     </LoadScript>
  )
}

export default MapContainer;
